package com.amaiz.cache.impl.clazz;

public class BaseClass {

    private String stringBaseClass;
    private Integer integerBaseClass;

    public String getStringBaseClass() {
        return stringBaseClass;
    }

    public void setStringBaseClass(String stringBaseClass) {
        this.stringBaseClass = stringBaseClass;
    }

    public Integer getIntegerBaseClass() {
        return integerBaseClass;
    }

    public void setIntegerBaseClass(Integer integerBaseClass) {
        this.integerBaseClass = integerBaseClass;
    }
}
